import React from 'react'
import Head from 'next/head'
import styled from '@emotion/styled'
import { Global } from '@emotion/core'
import { ThemeProvider } from 'emotion-theming'
import theme from '@rebass/preset'
import {
  Flex,
  Box
} from 'rebass'

export default () => {
  return (
    <ThemeProvider theme={theme}>
      <Global
        styles={css`
          html,
          body {
            padding: 0;
            margin: 0;
            background: papayawhip;
            min-height: 100%;
            font-family: Helvetica, Arial, sans-serif;
            font-size: 24px;
          }
        `}
      />
      <Head>
        <title>Grow your brunch spot | Sweetmenu</title>
      </Head>
      <div>
        <Flex
          flexDirection={['column', 'column', 'column', 'row']}
          className="sweetmenu__section">
          <Box className="sweetmenu__hero">
            <Title className="sweetmenu__hero--title" textTransform="uppercase">
              Grow your
              <strong>brunch spot</strong>
            </Title>
          </Box>
          <Box className="sweetmenu__demo">
          </Box>
        </Flex>
      </div>
    </ThemeProvider>
  )
}
